import React from 'react';
import { Button, Typography, Container} from '@material-ui/core';

function App() {
  return (

  <Container maxWidth="sm">
      <Typography variant="h3" gutterBottom>
        h3. Heading
      </Typography>
      <Button color="primary" variant="contained">BUTTON</Button>;
   </Container>
  )
}

export default App;
